import Fotos from "../assets/json/fotos.json";



export default function Home() {

  fetch(Fotos)
    .then(response => response.json())
    .then(resData => {
      console.log(JSON.stringify(resData))
      //do your logic here       
      let imagen = resData.results
      this.setState({ imagen: resData.results }); //this is an asynchronous function
    })
    
  return (
    <div id="Home">
      <h1>Natural Pic</h1>

      <Galeria />
    </div>
  );
}
